        <div className={"container"}>
            <div className={"row"}>
                {/*col-xl and col-md to 8 and 4, the rest to 12*/}
                <div className={"col-xl-8 col-md-8 col-12"}>
                    <Carousel/>
                </div>
            </div>
            <div className={"row"}>
                <div className={"col-12"}>
                </div>
            </div>
            <div className={"row"}>
                <div className={"col-12"}>
                </div>
            </div>
        </div>
    );
}
